// import { withRouter } from "react-router";
class Home extends React.Component {
//lifecycle
    componentDidMount() {
        setTimeout(() => {
           this.props.history.push('/todo') 
        }, 3000);
    }     




    render () {
        return (
            <div>
                HOME PAGE
            </div>
        )
    }
}
